import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import './skillCard.css';
import html from '../../Assets/html.png';

const SkillCard=()=>{

    return(
        <Fragment>
         <div className="skill_card">
             <div className="skill_card_img" style={{backgroundAttachment:'fixed'},{backgroundSize:'20%'},{background:'orange'}}>
                 <img src={html}></img>
             </div>
             <div className="skill_card_details"></div>
         </div>
        </Fragment>
    );

};

export default SkillCard;
